import React from "react";

interface Props {
  onClick: any;
  disabled: boolean;
}

export const PreviousPageButton = (props: Props) => {
  return (
    <button
      onClick={props.onClick}
      disabled={props.disabled}
      className="btn btn-outline-info"
    >
      {"<<"} Previous Page
    </button>
  );
};
